using namespace std;

typedef string (*search_func)(const string&);


struct engine_item {
	ustring name;
	unsigned char* img;
	ps_color c;
	search_func func;
	bool page_fold;
};


static string search_by_google(const string&);
static string search_by_baidu(const string&);
static string search_by_yicha(const string&);
static string search_by_easou(const string&);

extern unsigned char g_img32[];
extern unsigned char b_img32[];
extern unsigned char y_img32[];
extern unsigned char e_img32[];

extern unsigned char g_img16[];
extern unsigned char b_img16[];
extern unsigned char y_img16[];
extern unsigned char e_img16[];

class EngineImpl
{
public:
	EngineImpl()
	{
		int bits_pixel = Application::getInstance()->bits_pixel();
		engine_item item;
		item.name = ustring(U("Google"));
		if (bits_pixel == 32)
			item.img = g_img32;
		else
			item.img = g_img16;
		item.c.r=0; item.c.g=0.5; item.c.b=1; item.c.a=1;
		item.func = search_by_google;
		item.page_fold = true;

		m_items.push_back(item);

		engine_item item2;
		item2.name = ustring(U("百度"));
		if (bits_pixel == 32)
			item2.img = b_img32;
		else
			item2.img = b_img16;
		item2.c.r=0; item2.c.g=0.5; item2.c.b=1; item2.c.a=1;
		item2.func = search_by_baidu;
		item2.page_fold = true;

		m_items.push_back(item2);

		engine_item item3;
		item3.name = ustring(U("易查"));
		if (bits_pixel == 32)
			item3.img = y_img32;
		else
			item3.img = y_img16;
		item3.c.r=0; item3.c.g=0.5; item3.c.b=1; item3.c.a=1;
		item3.func = search_by_yicha;
		item3.page_fold = false;

		m_items.push_back(item3);

/*
		engine_item item4;
		item4.name = ustring(U("宜搜"));
		if (bits_pixel == 32)
			item4.img = e_img32;
		else
			item4.img = e_img16;
		item4.c.r=0; item4.c.g=0.5; item4.c.b=1; item4.c.a=1;
		item4.func = search_by_easou;
		item4.page_fold = false;

		m_items.push_back(item4);
        */
	}

	std::vector<engine_item> m_items; 
};


Engine::Engine()
	: m_impl(0)
	, current(2)
{
	m_impl = new EngineImpl;
}

Engine::~Engine()
{
	delete m_impl;
}

size_t Engine::getCount(void) const
{
	return m_impl->m_items.size();
}

int Engine::getDefaultId(void) const
{
	return current;
}

void Engine::setDefaultById(int id)
{
	current = id;
}

ustring Engine::getDefaultName(void) const
{
	return m_impl->m_items[current].name;
}

string Engine::searchByDefault(const string& keyword, bool * need_fold)
{
	if (need_fold)
		*need_fold = m_impl->m_items[current].page_fold;
	return m_impl->m_items[current].func(keyword);
}

std::vector<Engine::Item> Engine::getEngines(void)
{
	std::vector<Engine::Item> items;
	
	int byte_pixel = Application::getInstance()->bytes_pixel();

	for (size_t i=0; i<m_impl->m_items.size(); i++){
		Engine::Item item;
		item.id = i;
		item.name = m_impl->m_items[i].name;
		item.img = m_impl->m_items[i].img;
		item.w = 16;
		item.h = 16;
		item.p = 16*byte_pixel;
		item.c = m_impl->m_items[i].c;
		item.page_fold = m_impl->m_items[i].page_fold;
		items.push_back(item);
	}
	return items;
}

static string search_by_google(const string& keyword)
{
	stringstream os;
	os<<"http://www.google.com.hk/cse?cx=partner-pub-8199729008807893%3Amm5d6qv9vdu&ie=UTF-8&q="
	  <<keyword.c_str()<<"&sa=%CB%D1%CB%F7&siteurl=&siteurl=www.zncsoft.com%2Fgsearch.html";
	return os.str();
}

static string search_by_baidu(const string& keyword)
{
	stringstream os;
	os<<"http://www.baidu.com/baidu?wd="
	  <<keyword.c_str()<<"&tn=onecoolx_dg&ie=utf-8&oe=utf-8";
	return os.str();
}

static string search_by_yicha(const string& keyword)
{
	stringstream os;
	os<<"http://u.yicha.cn/union/c.jsp?keyword="
	  <<keyword.c_str()<<"&site=2145952334";
	return os.str();
}

static string search_by_easou(const string& keyword)
{
	stringstream os;
	os<<"http://ad2.easou.com:8080/j10ad/ea2.jsp?key="
	  <<keyword.c_str()<<"&cid=bacn3504_44443_D_1&channel=11&Submit=%D2%CB%CB%D1%CB%D1%CB%F7";
	return os.str();
}

